import classes from "./IntroductionBlock.module.css";
import bookAppointment from "./Bimalendu.jpeg";

function IntroductionBlock() {
  return (
    <div className={classes.IntroductionBlockParent}>
      <div className={classes.websiteContent}>
        <div className={classes.detailContainer}>

          <div className={classes.textHeading1}>
          It's me, Bimalendu Pradhan!
          </div>

          <div className={classes.textHeading2}> Housing Justice: Empowering People, Defending Homes</div>



          <div className={classes.textDetails}>
          Welcome to the forefront of change! I am Bimalendu Pradhan, a dedicated RERA activist fueled by a relentless passion to stand up for the people and combat the pressing real estate issues that deeply affect our communities. With unwavering determination, I strive to be a driving force in creating a brighter future where housing is recognized as a fundamental human right, not a mere privilege reserved for the fortunate few. I firmly believe that safe and affordable homes are the cornerstone of strong and empowered communities.

Through tireless advocacy, community engagement, and policy reform initiatives, I am committed to challenging the status quo and breaking down the barriers that hinder equitable access to housing. My mission is to uplift marginalized voices, empower vulnerable individuals, and foster a society where everyone can thrive in a place they proudly call home.
          </div>
        </div>


        <img
          className={classes.HomeImageContainer}
          src={bookAppointment}
          alt="logo"
        ></img>
      </div>
    </div>
  );
}

export default IntroductionBlock;
